DROP TABLE IF EXISTS countries;
CREATE TABLE countries
(
  id INT(10) unsigned PRIMARY KEY NOT NULL AUTO_INCREMENT,
  country VARCHAR(255) NOT NULL,
  fips104 VARCHAR(255) NOT NULL,
  iso2 VARCHAR(255) NOT NULL,
  iso3 VARCHAR(255) NOT NULL,
  ison VARCHAR(255) NOT NULL,
  internet VARCHAR(255) NOT NULL,
  capital VARCHAR(255),
  map_reference VARCHAR(255),
  nationality_singular VARCHAR(255),
  nationality_plural VARCHAR(255),
  currency VARCHAR(255),
  currency_code VARCHAR(255),
  population BIGINT(20),
  title VARCHAR(255),
  comment VARCHAR(255),
  created_at TIMESTAMP,
  updated_at TIMESTAMP,
  deleted_at TIMESTAMP
);
TRUNCATE countries;

